                        <span aria-hidden="true" className="absolute inset-0" />
                        
                      </a>
                    </h3>
                    <p className="mt-1 text-sm text-gray-500"></p>
                  </div>
                  <p className="text-sm font-medium text-gray-900"></p>
                </div>
              </div>
           
          </div>
        </div>
      </div>
    )
  };
  
  export default Products;
